import axios, { AxiosResponse } from "axios";

import { IUser } from "../types/response";

const URL: string = 'https://jsonplaceholder.typicode.com';

export const usersRequest = (): Promise<AxiosResponse<IUser[]>> => {
    return axios.get(URL + '/users');
};
